measurements.description:
Fifteen flowers on two inflorescences to 61cm long;
	dorsal sepal lemon yellow with fuchsia pink blush and spotting basally,
	lateral sepals lemon yellow with darker fuchsia spotting centrally;
	petals lemon yellow with fuchsia pink blush and heavier barring centrally;
	lip fuchsia pink, calli egg yolk yellow with fuchsia pink spots; column white; substance firm; texture matte.
